import React from "react";
import Card from "./Card";
import { robots } from "./robots";


const CardList = () => {

    return (

        <div>
            <Card id= {robots[0].id} botName={robots[0].name} email= {robots[0].email}/>
            <Card id= {robots[1].id} botName={robots[1].name} email= {robots[1].email}/>
            <Card id= {robots[2].id} botName={robots[2].name} email= {robots[2].email}/>
            <Card id= {robots[3].id} botName={robots[3].name} email= {robots[3].email}/>
       </div>

    );

};

export default CardList;
